// frontend/src/index.js

import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

// Import only the Bootstrap grid and utilities for layout
import 'bootstrap/dist/css/bootstrap-grid.min.css';
import 'bootstrap/dist/css/bootstrap-utilities.min.css';

import { createTheme, ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';

// Define our professional dark theme
const darkTheme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9', // A nice light blue
    },
    secondary: {
      main: '#f48fb1', // A light pink for contrast
    },
    background: {
      default: '#121212', // A deep, true black for the page background
      paper: '#1e1e1e',   // A slightly lighter black for cards and surfaces
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
    h4: {
      fontWeight: 700,
    },
  },
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <ThemeProvider theme={darkTheme}>
      {/* CssBaseline kicks off a reset to normalize styles */}
      <CssBaseline />
      <App />
    </ThemeProvider>
  </React.StrictMode>
);
